int closest(double num) {
  double curr = 0.1;
  int pos = 0;

  caratList.asMap().forEach((index, element) {
    if ((num - element).abs() < (num - curr).abs()) {
      curr = element;
      pos = index;
    }
  });
  return pos;
}

double calculatePrice(
    double caret, String shape, String color, String clarity) {
  if (caret == 0) return 0;

  int closetPos = closest(caret);
